import React from 'react';

import useStyles from './mystyle.module.css'; 
const Header = () => {
    const classes = useStyles();
    return (
        <div id="header" className={classes.jumbotron } >
            <h1>Graph Maker</h1>
            <hr/>
            <p>Create any ammount of graphs and use it on your page using iframes</p>
            <br/>
            <br/>
        
            <form>
                <div class="input-group">
                
                    <div class="input-group-btn">
                   
                        <button type="button" id="createGraph" class="btn btn-danger">Create your graphicon</button>
                    </div>
                </div>
            </form>
    </div>
    )
}

export default Header;
